function pooledImage = maxPooling(image, poolSize, stride)
    % Get the size of the input image
    [rows, cols] = size(image);

    % Calculate the size of the output
    pooledRows = floor((rows - poolSize) / stride) + 1;
    pooledCols = floor((cols - poolSize) / stride) + 1;

    % Initialize the output
    pooledImage = zeros(pooledRows, pooledCols);

    % Perform max pooling
    for i = 1:pooledRows
        for j = 1:pooledCols
            % Define the window for pooling
            rowStart = (i-1) * stride + 1;
            rowEnd = rowStart + poolSize - 1;
            colStart = (j-1) * stride + 1;
            colEnd = colStart + poolSize - 1;

            % Get the maximum value in the pooling window
            pooledImage(i, j) = max(max(image(rowStart:rowEnd, colStart:colEnd)));
        end
    end
end


